# Kruskal Wallis test
# http://www.r-tutor.com/elementary-statistics/non-parametric-methods/kruskal-wallis-test
library("PMCMR")

# utility functions
printPvalues <- function(pvalues, keys) {
  #pvalues <- pvalues[-1]
  sorted <- sort(pvalues, index.return=TRUE)

  i <- 1
  for (x in sorted$x) {
    ix <- as.integer(sorted$ix[i]) + 1 # add +1 since pvalues is missing the control variable
    key <- k[ix]
    s<- toString(c(keys[ix], toString(x)))
    print(s)
    i <- i + 1
  }
}


